import React from 'react';
import './IntroductionSection.css';
import temp from './temp.png';

export default function IntroductionSection() {
    return (
        <div className="intro">
            &nbsp; {/* non-breaking space */}
            <h1 
            style={{fontSize: 40}}
            className="intro_title">
                Welcome to my Website 
            </h1>
            &nbsp;
            <div className="row">
                <div><h3>I am a very curious person and willing to commit myself fully to projects 
                    that I really enjoy. </h3></div>
            <img className="photo" src={temp} width="250" height="340" alt="whaaaat" />
            </div>
            &nbsp;
            <p className="text_customized"><i>
                You can find here extended information about my CV, what projects I have done 
                (with code sources and explanation).</i>
            </p>
            <p>
                For now, this website is rudimentary, but I will improve it as my knowledge of react grows.
            </p>
            <div className="vertical_space"/>
        </div>
    )
}
